import React, { useState, useEffect } from "react";
import {
	View,
	Text,
	ScrollView,
	TouchableOpacity,
	Image,
	Dimensions,
} from "react-native";

import HeaderView from "../../components/Layouts/Header";
import MainImage from "../../components/Layouts/MainImage";
import usePreference from "../../Hooks/usePreferences";
import firebase from "../../../Firebase/Firebase";
import { useNavigation } from "@react-navigation/native";
import { Icon } from "react-native-elements";

export default function MisBingos(props) {
	const navigation = useNavigation();
	const { userFbData } = usePreference();
	const [bingos, setBingos] = useState([]);
	let bingosToArray = [];

	useEffect(() => {
		firebase
			.database()
			.ref(`Users/${userFbData.uid}/bingos`)
			.on("value", (snapshot) => {
				setBingos(snapshot.val());
			});
	}, []);

	const { width, height } = Dimensions.get("window");

	if (bingos) {
		Object.keys(bingos).forEach((key, i) => {
			bingosToArray[i] = bingos[key];
		});

		return (
			<View >
				<HeaderView props={props} />
				<View
					style={{
						width: width,
						height,
						height: height,
						backgroundColor:"#A9B4C0"
					}}
				>
					<Image
					style={{ width: width, height: height * 0.80, borderRadius: 30,borderWidth: 1, borderColor: '#03255f', marginTop: 10 }}
						source={{
							uri:
								"https://firebasestorage.googleapis.com/v0/b/jornadas2020.appspot.com/o/Sources%2Ftelebingo%20jpg.jpg?alt=media&token=f6b9100a-63f4-460b-8df5-42f3fca67b6d",
						}}
					/>
					<View style={{ alignSelf: 'center' }}>
						<TouchableOpacity
							onPress={() => navigation.navigate("Home")}
						>
							<Icon
								raised
								name="arrow-left"
								type="font-awesome"
								color="#03255F"
							/>
						</TouchableOpacity>
					</View>
				</View>
				{/* <MainImage />
				<Text style={[styles.titles, { margin: 15 }]}>Mis Bingos</Text>
				<ScrollView>
					{bingosToArray.map((bingos, i) => {
						return (
							<View key={i} style={{ margin: 10, backgroundColor: "#fff" }}>
								<View style={{ alignItems: "center" }}>
									<View style={{ flexDirection: "row" }}>
										<Text
											style={{
												fontWeight: "bold",
												color: "#03255F",
												fontSize: 15,
											}}
										>
											Cartones:{"  "}
										</Text>
										<Text style={{ color: "#03255F", marginRight: 20 }}>
											{bingos.cartones}
										</Text>
										<Text
											style={{
												fontWeight: "bold",
												color: "#03255F",
												fontSize: 15,
											}}
										>
											Numero de juego:{"  "}
										</Text>
										<Text style={{ color: "#03255F", marginRight: 20 }}>
											{bingos.numero_de_juego}
										</Text>
										<Text
											style={{
												fontWeight: "bold",
												color: "#03255F",
												fontSize: 15,
											}}
										>
											Ganador:{"  "}
										</Text>
										{bingos.ganador ? (
											<Text style={{ color: "#03255F", marginRight: 20 }}>
												Si
											</Text>
										) : (
											<Text style={{ color: "#03255F", marginRight: 20 }}>
												no
											</Text>
										)}
									</View>
									<Text style={{ fontWeight: "bold", color: "#696969" }}>
										{bingos.total}CLP {"  "} {bingos.fecha}
									</Text>
									<View style={{ flexDirection: "row" }}>
										<Text
											style={{
												fontWeight: "bold",
