										</Text>
									</View>
								</View>
							</View>
						);
					})}
				</ScrollView>
				<View style={[styles.buttons, { marginTop: 40, marginBottom: 40 }]}>
					<TouchableOpacity
						onPress={() => navigation.navigate("Home")}
						style={styles.buttonPagar}
					>
						<Text style={styles.textSubmit}>Volver</Text>
					</TouchableOpacity>
				</View> */}
			</View>
		);
	} else {
		return (
			<View >
				<HeaderView props={props} />
				<View
					style={{
						width: width,
						height,
						height: height,
						backgroundColor:"#A9B4C0"
					}}
				>
					<Image
					style={{ width: width, height: height * 0.80, borderRadius: 30,borderWidth: 1, borderColor: '#03255f', marginTop: 10 }}
						source={{
							uri:
								"https://firebasestorage.googleapis.com/v0/b/jornadas2020.appspot.com/o/Sources%2Ftelebingo%20jpg.jpg?alt=media&token=f6b9100a-63f4-460b-8df5-42f3fca67b6d",
						}}
					/>
					<View style={{ alignSelf: 'center' }}>
						<TouchableOpacity
							onPress={() => navigation.navigate("Home")}
						>
							<Icon
								raised
								name="arrow-left"
								type="font-awesome"
								color="#03255F"
							/>
						</TouchableOpacity>
					</View>
				</View>
				{/* <MainImage />
				<View style={{ alignItems: "center", marginTop: 30 }}>
					<Text style={styles.form}>Mis Donaciones</Text>
					<Text
						style={{
							fontWeight: "bold",
							color: "#03255F",
							fontSize: 15,
						}}
					>
						No se registran donaciones
					</Text>
				</View>
				<View style={[styles.buttons, { marginTop: 40, marginBottom: 40 }]}>
					<TouchableOpacity
						onPress={() => navigation.navigate("Home")}
